import prettyReact from './images/react-full.png'

export default function NavBar() {
  function addOpacity() {
    const image = document.getElementById('image');
   image.style.opacity = 0.5;
  }

  function removeOpacity() {
    const image = document.getElementById('image');
   image.style.opacity = 1;
  }

  return (
   <div className='new'>
        <img src={ prettyReact } alt='React logo' id='image' onMouseEnter={addOpacity} onMouseLeave={removeOpacity}/>
        <button className='button'>Click me</button>
   </div>
  );
};
